import React from 'react';
import { StyleSheet, View, Image, Dimensions, Text } from 'react-native';

function Card(){
    return(
        <View style={styles.container}>
            <Text>a</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    container:{
        width:400,
        height:150
    }
    
});

export {Card}
